  return (
    <>
      <div className="container mx-auto">
        <div className="hero min-h-full lg:mt-5 align-center py-5">
          <div>
            <div className="flex flex-col text-center items-center">
              <h1 className="text-5xl font-bold">Where would you like to go today?</h1>

            </div>
          </div>
        </div>
        <div className="grid grid-cols-2 mx-auto gap-4 justify-center text-center">
          {
            planets.map((planet) => {
              <div >
                <button className="focus:border-4 rounded-xl mx-auto">
                  <figure><img className="rounded-xl object-contain " src="/images/titan.jpg" alt="Titan" width={300} /></figure>
                </button>
              </div>
            })
}

</div>
        {/* <div className="card card-compact w-96 bg-base-100 shadow-xl">
          <figure><img src="/images/titan.jpg" alt="Shoes" /></figure>

        </div> */}
      </div>
    </>
  );
}
export default Home;
